This a Full Remote job, the offer is available from: Italy

Ti piacerebbe unirti ad un azienda in cui le tue idee, le tue competenze e la tua passione convergeranno per dare forma alla prossima generazione di soluzioni biomedicali?

Se questo è ciò che che cerchi, allora sei pronto a navigare sulla nave dell'innovazione!

Stiamo attualmente cercando un SENIOR MOBILE SOFTWARE DEVELOPER C#,figura che risponderà direttamente al Global Engine Developer e che sarà di riferimento per l'attività dell'area.

Lavorerà a fianco del team di sviluppatori e con i vari stakeholder presenti in di diversi livelli della struttura e della distribuzione delle applicazioni al fine di sviluppare e progettare applicazioni e framework mobile applicando le migliori soluzioni.

La persona avrà base in Italia e lavorerà in full remote.

QUALE PROFILO STIAMO CERCANDO?

I Principali Requisiti Per L'attività Sono
• Cinque anni di esperienza nello sviluppo di progetti C# e C++ con una comprovata capacità di progettazione e sviluppo di librerie per dispositivi mobili utilizzando i linguaggi Swift e Java e Kotlin;
• Esperienza nello sviluppo di architetture e sistemi di comunicazione tramite C#, Maui e Xamarin;
• Esperienza nella gestione di progetti tramite dispositivi bluetooth volti alla creazione di un codice autoesplicativo, ben strutturato e documentato;
• Esperienza con le interfacce per i dispositivi basati su BLE utilizzando i framework dei sistemi operativi mobile;
• Esperienza nella programmazione funzionale, asincrona, orientata agli eventi e orientata agli oggetti;
• Capacità di gestione della programmazione per ambienti con risorse limitate, con particolare attenzione all'ottimizzazione e alla semplificazione;
• Comprensione dei design pattern e dei principi di pulizia del codice;
• Solida esperienza con strumenti di debug avanzati.

SEDE DI LAVORO: Italia, Full Remote

Pensi che questa opportunità possa essere di interesse?

Candidati subito, ti aspettiamo per un primo colloquio!

