Leaf Software è alla ricerca di una persona molto motivata con vera passione per la programmazione ed in particolare per lo sviluppo di applicazioni mobile per piattaforme iOS.

Il candidato ideale deve essere in possesso di:
esperienza nello sviluppo di applicazioni per piattaforma iOS;
conoscenza dei linguaggi Objective-C e Swift;
conoscenza di Xcode, Interface Builder ed Autolayout;
conoscenza delle basi della comunicazione client-server e utilizzo di API REST, JSON, XML;
conoscenza del sistema di version control Git;
conoscenza di CocoaPods;
gradita conoscenza SQL;
capacità di lavorare in Team.
